7	[{"type": "full_richtext", "value": "<p data-block-key=\\"rmm95\\"></p><embed alt=\\"70sSnow.jpg\\" embedtype=\\"image\\" format=\\"fullwidth\\" id=\\"4\\"/><p data-block-key=\\"h11te\\"></p>", "id": "44267a53-f211-4750-8630-049e94f10c15"}, {"type": "full_richtext", "value": "<p data-block-key=\\"fa3ni\\">We are always interested in members. Please join us by downloading the <a id=\\"83\\" linktype=\\"document\\">membership form</a>. Fill it out and mail it to :</p><p data-block-key=\\"ejdmx\\">Lodi/Harrisville Historical Society<br/>P.O. Box 172<br/>Lodi, OH 44254</p>", "id": "a2fb10f0-ca1c-434e-a359-faa1d719aeb8"}]	Join the Lodi Harrisville Historical Society
5	[{"type": "full_richtext", "value": "<p>Chronology of Harrisville Township &amp; Lodi Villiage</p><h3>1810</h3><p>Harrisville Township surveyed; Joseph Harris built first house in Medina County</p><h3>1811</h3><p>Feb.: Joseph Harris, his wife, Rachel, and son Albert, and James S. Redfield, a boy of eleven settled in Harris&#x27;s cabin</p><h3>1814</h3><p>First settlers since 1811 came to Harrisville. Harrisville became Township 1, Range 16.</p><h3>1815</h3><p>April: First child born in Harrisville</p><h3>1816</h3><p>November: First wedding in Harrisville - Levi Holcomb and Laura Marsh</p><h3>1817</h3><p>First school built; first township election</p><h3>1818</h3><p>Medina Co. formed</p><h3>1819</h3><p>Thirty nine votes cast in first state and county election</p><h3>1820</h3><p>First dry goods store opened by James S. Redfield</p><h3>1824</h3><p>Harris House built</p><h3>1827</h3><p>Township divided into school districts</p><h3>1829</h3><p>Congregational Church founded</p><h3>1834</h3><p>Harrisville Post Office established</p><p>First woolen mill built by James Rickey.</p><h3>1835</h3><p>Warren House Hotel built</p><h3>1846</h3><p>First Methodist Church founded.</p><h3>1846</h3><p>Harrisville Lodge 137, F and A.M. instituted</p><h3>1859</h3><p>First Masonic Temple built. (it burned in 1870)</p><h3>1863</h3><p>First National Bank established</p><h3>1866</h3><p>Ainsworth Building built</p><h3>1868</h3><p>Academy started</p><h3>1870</h3><p>Academy completed</p><h3>1871</h3><p>Boarding Hall erected and Academy opened</p><h3>1878</h3><p>Academy purchased, and Lodi three-year high school started 1880</p><p>Wheeling and Lake Erie R.R. built. A.B. Taylor built wood turning mill.</p><h3>1881</h3><p>First passenger train on W. And L. E.</p><h3>1883</h3><p>First graduating class, Lodi High School, five members.</p><h3>1884</h3><p>Opera House built. (now City Hardware building)</p><h3>1886</h3><p>Lodi Review founded by H.E. Basset</p><p>Central Park deeded to village by the Harris family</p><h3>1887</h3><p>Garden Isle Farms started</p><h3>1888</h3><p>Rice Lumber Mill established by Joseph and Clement Rice</p><h3>1889</h3><p>First gas well on present hospital grounds</p><h3>1890</h3><p>Fire Dept. organized</p><h3>1891</h3><p>B. and O. railroad built</p><h3>1892</h3><p>Lodi incorporated</p><p>Rowland Drug Store started by Albert and Charles Rowland</p><h3>1895</h3><p>White Rose Creamery started.</p><h3>1897</h3><p>Woodlawn Cemetery Association organized</p><h3>1898</h3><p>Taylor Inn built</p><p>Lodi Business Men&#x27;s Association formed</p><p>Home for Aged Women founded by Mrs. Elvira Ainsworth and Mrs. Clarissa Rounds</p><p>First telephones (Star Telephone company)</p><h3>1900</h3><p>Mound Lodge 845 organized</p><p>First oil company organized</p><h3>1902</h3><p>Harrisville Chapter 137, Order Eastern Star instituted</p><h3>1904</h3><p>First elecric plant</p><p>Rebekah Lodge 596 instituded</p><p>K.O.T.M. Tent organized</p><h3>1905</h3><p>L.T.O.M. Hive organized</p><h3>1906</h3><p>B. and O. Railroad built 1908</p><p>Masonic Temple built</p><p>Idol Theater built</p><h3>1909</h3><p>South-Western Interurban completed</p><p>First automobile in Lodi</p><h3>1911</h3><p>Centennial Celebration</p><h3>1912</h3><p>Present waterworks built</p><p>Present Rice Lumber Mill built</p><h3>1913</h3><p>Lodi Commercial Club organized</p><h3>1914</h3><p>School addition</p><h3>1915</h3><p>Disposal plant built</p><h3>1918</h3><p>Medina and Wooster Streets built</p><h3>1920</h3><p>Bank Street and the Square paved</p><h3>1921</h3><p>American Legion organized</p><h3>1922</h3><p>American Legion Auxiliary organized</p><p>Present Methodist Church dedicated</p><h3>1923</h3><p>Park deeded to Village by Mr. and Mrs. C.E. Knapp</p><h3>1926</h3><p>Rotary Club organized</p><p>Boy Scouts organized</p><h3>1931</h3><p>South-Western Interurban discontinued</p><h3>1932</h3><p>Lodi State Bank robbed</p><p>Harrisville Grange organized</p><h3>1944</h3><p>Boots and Saddle Club organized</p><h3>1949</h3><p>Lodi Commercial Club became Lodi Chamber of Commerce</p><h3>1950</h3><p>Business and Professional Women&#x27;s Club organized</p><h3>1951</h3><p>Mastodon skeleton discovered on Dr. Mabry farm</p><h3>1956</h3><p>Mail delivery established</p><h3>1957</h3><p>Garden club organized</p><h3>1960</h3><p>Cloverleaf Senior High School completed</p><p>Lodi Library organized</p>", "id": "1af2471f-5a61-4b64-9bb9-de8ec1cc314c"}]	A history of Lodi and Harrisville
11	[{"type": "full_richtext", "value": "<p><b>Video links</b></p><p><a href=\\"https://youtu.be/stPVq9bYALY\\">Circa 1956</a></p><p><a href=\\"https://youtu.be/vhA8ByC0rf0\\">Lodi Parade</a></p><p><a href=\\"https://youtu.be/iC1cG93HhjE\\">Lodi Pet Parade and various scenes of Lodi</a></p>", "id": "a9ce6bb6-3327-4e1c-bb93-9a022e8e30be"}]	Old Videos from Lodi and Harrisville
33	[{"type": "full_richtext", "value": "<p data-block-key=\\"hootb\\"></p><embed alt=\\"rhodo6.jpg\\" embedtype=\\"image\\" format=\\"left\\" id=\\"13\\"/><p data-block-key=\\"d4sa\\"></p><p data-block-key=\\"emr2n\\">You are cordially invited to join the Friends of the Union Cemeteries. The purpose of this membership is to bring together Lodi and Harrisville Twp. residents who are concerned with the maintenance, beautification, and perpetuation of our two Lodi Village cemeteries and two Harrisville Twp. cemeteries.</p><p data-block-key=\\"1fjer\\"></p><p data-block-key=\\"e8pk5\\">The Friends of the Cemeteries will provide an advocacy group which will work in conjunction with the Lodi Village, Harrisville Twp., and the Union Cemetery Board. Our Friends board consist of Co-Presidents Letha Mapes and Chris Goodrow, Vice President Cathy Wells and Sec\\u2019y/Treasurer Jarred Grant.</p><p data-block-key=\\"2oe2t\\"></p><p data-block-key=\\"16dcj\\">We have established a nonprofit ( 501c3) and a bank account at the Lodi Huntington Bank. There is great importance in the support and interest of our cemeteries, and we need to work together to improve current conditions not only in the future, but as a tribute to the memory of those who in the past established their grounds as memorial parks.</p>", "id": "062537ee-ab4e-4b3a-bdca-7bdfe2d89b27"}, {"type": "docLink", "value": 82, "id": "c8f66a6c-a73f-4d62-8f23-dceeda65f7e2"}]	FRIENDS OF THE CEMETERIES
\.


