3	2	Lodi Harrisville Historical Society	<h2 data-block-key="n2jd3">A small town rich in history, set in the heart of Ohio</h2><p data-block-key="0zw5a">The county&#x27;s oldest settlement, Lodi is known for it&#x27;s railroad bridges, beautiful rhododendron trees, corn festival and Indian statue. Lodi is nestled in Medina County, approximately 50 miles south of Cleveland and 30 miles west of Akron.</p><h4 data-block-key="exxf3">Hours</h4><p data-block-key="rjcio">Open the 4th Sunday of each month, April thru October.</p><p data-block-key="clp7">Our monthly meeting are the 4th Thursday of each month. All welcomed.</p><p data-block-key="9lga5">We are not open to public in February, March, May, November, and December. By appointment only call 330-635-7294</p><p data-block-key="0cnzy">We will open for private tours, business meetings, pictures, and social gatherings on request and if available . Please use the contact page or message through Facebook.</p><p data-block-key="22tg2">A blog post about the Lodi Harrisville Historical Society has been published. You can view it at<a href="https://vwmandmcdl.blogspot.com/2021/12/get-to-know-your-local-historical.html">https://vwmandmcdl.blogspot.com/2021/12/get-to-know-your-local-historical.html</a>.</p><h4 data-block-key="rv3k5">Address</h4><p data-block-key="970ff">Lodi Harrisville Historical Society<br/>Box 172<br/>Lodi, Ohio 44254</p><h2 data-block-key="30ap">Quilt Raffle</h2><embed alt="flyer 2" embedtype="image" format="left" id="30"/><p data-block-key="dbp5j"><a href="https://lodiharrisvillehistorical.org/photos/collection/quilts/">Quilt Photos.</a></p>	<p data-block-key="gog6p"></p><p data-block-key="les8h"></p><embed alt="Waite House" embedtype="image" format="left" id="21"/><p data-block-key="0xpwc"></p><p data-block-key="b787j"></p><p data-block-key="0e4ix">The Waite House is the home of the Lodi Harrisville Historical Society. Located right off the Lodi Square on Ainsworth Street.</p><p data-block-key="doa0i"></p><embed alt="flyer 1" embedtype="image" format="left" id="31"/><p data-block-key="9k21r"></p>
\.


