8	Photos from Lodi/Harrisville	[{"type": "photo_category", "value": {"heading": "Quilt Raffle", "paragraph": "<p data-block-key=\\"t05pi\\">This quilt was graciously donated by the family to LHHS to raise funds for our various endeavors. This includes but is not limited to the research, preservation and education of our local history, as well as museum maintenance. Drawing to be held at the museum on or about 12/2/23.</p>", "image": 28, "category": 4}, "id": "a814dc3b-4c0f-4152-b887-5a82f96f4bc4"}, {"type": "photo_category", "value": {"heading": "Historical Photos", "paragraph": "<p data-block-key=\\"cyg5w\\">Images from around Lodi and Harrisville from days gone by</p>", "image": 1, "category": 1}, "id": "60b249f5-7ad1-4e1f-b3de-f456dabab8d9"}, {"type": "photo_category", "value": {"heading": "Railroad", "paragraph": "<p data-block-key=\\"doctq\\">Lodi has been a railroad town since the early days.</p>", "image": 8, "category": 2}, "id": "9fadbed9-4cb1-40b0-88a3-4cbe22a13f02"}, {"type": "photo_category", "value": {"heading": "Woodlawn Cemetery Rhododendrons", "paragraph": "<p data-block-key=\\"o2n65\\">Lodi has become known as a Rhododendron Village. It likely started with the beautiful rhododendrons that are planted throughout Woodlawn Cemetery. They blossom on Memorial Day Weekend each year.</p>", "image": 13, "category": 3}, "id": "f00b1ac2-8e64-4dbb-9c58-eb12b7a2eafe"}]
