90	f	2023-10-28 23:26:40.872246-04	{"pk": 33, "live": false, "path": "00010001000A", "slug": "cemetery", "depth": 3, "owner": 1, "title": "Cemetery", "locale": 1, "locked": false, "content": "[{\\"type\\": \\"full_richtext\\", \\"value\\": \\"<p data-block-key=\\\\\\"hootb\\\\\\"></p><embed alt=\\\\\\"rhodo6.jpg\\\\\\" embedtype=\\\\\\"image\\\\\\" format=\\\\\\"left\\\\\\" id=\\\\\\"13\\\\\\"/><p data-block-key=\\\\\\"d4sa\\\\\\"></p><p data-block-key=\\\\\\"emr2n\\\\\\">You are cordially invited to join the Friends of the Union Cemeteries. The purpose of this membership is to bring together Lodi and Harrisville Twp. residents who are concerned with the maintenance, beautification, and perpetuation of our two Lodi Village cemeteries and two Harrisville Twp. cemeteries.</p><p data-block-key=\\\\\\"1fjer\\\\\\"></p><p data-block-key=\\\\\\"e8pk5\\\\\\">The Friends of the Cemeteries will provide an advocacy group which will work in conjunction with the Lodi Village, Harrisville Twp., and the Union Cemetery Board. Our Friends board consist of Co-Presidents Letha Mapes and Chris Goodrow, Vice President Cathy Wells and Sec\\\\u2019y/Treasurer Jarred Grant.</p><p data-block-key=\\\\\\"2oe2t\\\\\\"></p><p data-block-key=\\\\\\"16dcj\\\\\\">We have established a nonprofit ( 501c3) and a bank account at the Lodi Huntington Bank. There is great importance in the support and interest of our cemeteries, and we need to work together to improve current conditions not only in the future, but as a tribute to the memory of those who in the past established their grounds as memorial parks.</p>\\", \\"id\\": \\"062537ee-ab4e-4b3a-bdca-7bdfe2d89b27\\"}]", "expired": false, "alias_of": null, "numchild": 0, "subtitle": "FRIENDS OF THE CEMETERIES", "url_path": "/home/cemetery/", "expire_at": null, "locked_at": null, "locked_by": null, "seo_title": "", "go_live_at": null, "draft_title": "Cemetery", "content_type": 7, "live_revision": null, "show_in_menus": false, "translation_key": "2c9349