301	{"name": "Dave Gilson", "email": "Gilson4830@gmail.com", "message": "I have an item that may be of interest to the Lodi Historical Society.  It's a microscope that belonged to Doctor Mabry, the veterinarian that had his practice on Bank Street in the early and mid 1900's.  His son, Charlie Mabry, was my brother-in-law, married to my sister, Ramona.  After Charlie passed away a couple years ago, it was discovered that there were some things from the vet's practice still in the basement of the family home.  His microscope was one of them.  The scope was given to me and I spent some time restoring it and the wood box that it was found in.  I believe that this scope is part of Lodi history and would like it to be in the hands of people who are trying to preserve that history.  \\r\\n\\r\\nIf you're interested, I'd like to donate the scope to your Historical Society so it can be on display for the public instead of sitting in my workshop.  If you want to see the scope in order to decide if it's correct for your museum, I can bring it to you, or you can come to my home to have a look.  If you don't think it's proper for display in your museum I'll understand.\\r\\n\\r\\nBest Regards,\\r\\nDave Gilson\\r\\n4830 Mandarin Drive, Seville, OH 44273\\r\\n330-769-2991"}	2023-06-30 12:24:19.59568-04	10
