616	{"name": "Michaelunfam", "email": "pulcfibucyp1977@mail.ru", "message": "Odysseus lunar lander shares new photos from its harrowing descent \\r\\n<a href=https://blackspfgh3bi6im374fgl54qliir6to37txpkkd6ucfiu7whfy2odid.ltd>    </a> \\r\\nThe Odysseus spacecraft has dispatched new images it captured of the lunar surface during the landers harrowing approach to the moon. The vehicle softly touched down on the moon on Thursday, becoming the first US-made lander to do so since the Apollo era. \\r\\n \\r\\nThe grainy images were shared by Intuitive Machines, the company that developed Odysseus, on Monday morning. The company had initially projected that the lander could deliver the first images captured from the lunar surface in the hours after landing, but communicating with the spacecraft has proven challenging. \\r\\nhttps://blackspruty4w3j4bzyhlk24jr32wbpnfo3oyywn4ckwylo4hkcyy4yda.com \\r\\n  \\r\\nThe mission team believes Odysseus tripped on the lunar soil and landed on its side, resting on a rock, which may have left some of the vehicles antennas pointed in an inopportune direction, Intuitive Machines revealed Friday. \\r\\n \\r\\nIn its update Monday, the company also said it now expects to lose contact with Odysseus on Tuesday  days earlier than initially hoped. \\r\\n \\r\\nFlight controllers intend to collect data until the landers solar panels are no longer exposed to light, the company said in the update posted on the social media platform X. Based on Earth and Moon positioning, we believe flight controllers will continue to communicate with Odysseus until Tuesday morning. \\r\\n \\r\\nAt that point, Odysseus will have been operating less than five days on the lunar surface. The company had suggested in previous updates that the lander could function for up to nine days."}	2024-05-05 19:07:03.735494-04	10
